import React, { Component } from 'react';
import './App.css';
// import {Route, Link} from 'react-router-dom'
// import axios from 'axios'
import jsonp from 'jsonp';

const NYT_API = "https://api.nytimes.com/svc/search/v2/articlesearch.json?q=tariffs&api-key=S4G7oWgRSHAPBeUzDtI4hi6a31G82Bno"


class App extends Component {
  constructor(props) {
    super(props)

    this.state = {
      headlines: []
    }
  }


  componentDidMount() {
    jsonp(NYT_API, null, (err, data)=>{
      console.log(data)
      if(err){
        alert('sanity check')
        alert(err)
      }
      else return console.log(data)
    })
  }

  render() {
    return (
      <div className="App">
        <h1>Hey</h1>
      </div>
    );
  }
}

export default App;
